import Contact from "../Contact";
import styles from "./styles.module.css";
import Iframe from "react-iframe";

const Footer = () => {
  return (
    <footer className={styles.footerContainer}>
      <Contact />
      <Iframe
        url="https://1map.com/js/script-for-user.js?embed_id=1158612"
        width="1300px"
        height="350px"
        id="map-component"
        className="map-frame"
        display="block"
        position="relative"
      />
    </footer>
  );
};

export default Footer;
